  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kenai
  National Moose Range outlines Refuge accomplishments during the 1974 fiscal year.
  The report begins by summarizing the weather conditions and habitat conditions during
  the year. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, mammals, raptors, and fish- is also covered. The
  Refuge development and maintenance section discusses physical developments, plantings,
  and wildfires. Resource management is outlined; topics include fur harvesting and
  timber removal. A progress report on field investigations and applied research is
  also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, hunting, violations, and safety.\",\n\t\"license_title\":
